import React from 'react';
import { Routes, Route } from 'react-router-dom';
import AdminDashboard from './AdminDashboard';
import UserManagement from './';
import Payment from './Payment';  // Make sure you have a Payment component
import Statistics from './Statistics';  // Make sure you have a Statistics component
import AdminSidebar from './AdminSidebar';
import './MainAdminDashboard.css'; // Add necessary CSS

const MainAdminDashboard = () => {
  return (
    <div className="main-admin-dashboard">
      <AdminSidebar />
      <div className="admin-dashboard-content">
        <Routes>
          <Route path="/" element={<AdminDashboard />} />
          <Route path="/users" element={<UserManagement />} />
          <Route path="/accounts" element={<Payment />} />
          <Route path="/statistics" element={<Statistics />} />
        </Routes>
      </div>
    </div>
  );
};

export default MainAdminDashboard;
